import React from 'react';
import { Link } from 'react-router-dom';
import '../style/allBlog.css';
import elon from '../external/elon.jpg';

const Blogs = () => {
    return (<div>
        <Link id="new-post" to="/create-post/new-post">New Post</Link>
        <div id="grid">
            <div id="grid-items">
                <div id="card">
                    <img src={elon} id="card-img" alt="not-found" />
                    <div id="card-content">
                        <h1 id="card-header">Elon's MasterMind</h1>
                        <p id="card-text">Elon Musk cofounded six companies including
                            electric car maker Tesla, rocket producer
                            SpaceX and tunneling startup Boring Company.</p>
                        <button id="card-button">Read<span>&rarr;</span></button>
                    </div>
                </div>
            </div>
        </div>
    </div>);
}

export default Blogs;
